import React from 'react'

function App(){

    const table = {
        width: '100%',
        borderCollapse: 'collapse'
    }
const tableHeadRow={
    border: '1px solid #dddddd',
    padding: '18px',
    textAlign: 'left'
}
    

    const bioData = [
        {name: 'Jack', age: 24, language: 'English'},
        {name: 'James', age: 26, language: 'Russian'},
        {name: 'Rostov', age: 28, language: 'Spanish'}
    ]   
    console.warn(bioData)
return(
    <>
    <h1>Nested List With Nested Array</h1>
    
{
bioData.map((data)=>{
    return(
        <>
<table style={table}>
<thead>

<tr>
    <th style={tableHeadRow}>Name</th>
    <th style={tableHeadRow}>Age</th>
    <th style={tableHeadRow}>Language</th>

</tr>
</thead>
    <tbody>
<tr>
    <td style={tableHeadRow}>{data.name}</td>
    <td style={tableHeadRow}>{data.age}</td>
    <td style={tableHeadRow}>{data.language}</td>

</tr>

</tbody>

</table>
</>
)
})

}
    </>
)
}

export default App
